import axios from "axios";

const getAllprofileRequest = () => {
  return {
    type: "GET_ALL_DATA_PROFILE_REQUEST",
  };
};

const getProfileSuccess = (data) => {
  return {
    type: "GET_ALL_DATA_PROFILE_SUCCESS",
    payload: data,
  };
};

const getProfileIdFail = (err) => {
  return {
    type: "GET_ALL_DATA_PROFILE_FAIL",
    payload: err,
  };
};

export const getProfileId = () => {
  return (dispatch) => {
    dispatch(getAllprofileIdRequest());
    return axios
      .get(`https://63dbba8ec45e08a0434c7f61.mockapi.io/Worker`)
      .then((res) => {
        dispatch(getProfileIdSuccess(res.data));
      })
      .catch((err) => {
        dispatch(getProfileIdFail(err.response.data));
      });
  };
};
